import { Component, Inject } from '@angular/core';
import { MAT_DIALOG_DATA } from '@angular/material/dialog';


@Component({
  selector: 'app-workout-details',
  templateUrl: './workout-details.component.html',
  styleUrls: ['./workout-details.component.css']
})
export class WorkoutDetailsComponent {

  constructor(@Inject(MAT_DIALOG_DATA) public workout: any) { }
}
<h2>{{ workout.name }}</h2>
<ul>
  <li *ngFor="let exercise of workout.exercises">
    {{ exercise.setType }}: {{ exercise.sets }} sets of {{ exercise.repetitions }} reps at {{ exercise.weight }} kg
  </li>
</ul>
